import { useState } from "react";

const Prueba = () => {
  return (
    <div>
      <div className="header">
        <div className="container">
          <div className="btn-menu">
            <label for="" className="icon-menu"></label>
          </div>
          <div className="logo">
            <h1>Slee Dw</h1>
          </div>
          <nav className="menu">
            <a href="#">Inicio</a>
            <a href="#">Nosotros</a>
            <a href="#">Blog</a>
            <a href="#">Contacto</a>
          </nav>
        </div>
      </div>
      <div className="capa"></div>
    </div>
  );
};
export default Prueba;
